bullet_description:
Fenvi PCIE Network Card with Wi-Fi 6E Technology -- This Wifi 6E Card delivers higher peak data rates and up to 4x capacity in dense or congested environments. With Intel AX210, 2400Mbps over 5GHz or 600Mbps over 2 4GHz for online gaming and 8K Ultra HD video streaming;
Wi-Fi 6E Card with Bluetooth 5.2 Technology: use brand new 5.2 technology that expand the range of 4 x bluetooth signal, no need to worry the signal will be weak in the room and waiting long time for transport the large files, the new bluetooth 5.2 will solve this problem, and it can connect with the mouse, earphone, keyboard and other bluetooth devices ( Note: you have to insert the power cable to the Motherboard 9-pin interface for Bluetooth function );
Compatibility OS -- Supports Windows 10 64-bit for desktop;
WiFi 6E Network Card -- supports OFDMA and AX MU-MIMO technology;
Compatible with PCIe X1/X4/X8/X16 slots.
With CD Driver,you can search driver in fenvi website or I N T E L driver.
